import React from 'react';
import Header from './Home';
import NavBar from './'

export default function Index() {
    return (
      <div>
          <section className="header">
              <Header />
              <NavBar />
          </section>
        <p>Hello Next.js</p>
        <style jsx>{`
        @import url('https://fonts.googleapis.com/css?family=Raleway&display=swap');
            section,
            .header {
                width: 100vw;
                height: 25vh;
                background-color: blue;
            }
         `}</style>
      </div>
    );
  }
